##########\n\nfrom dask_interface import Deisa\n# from deisa import Deisa\nfrom dask.distributed import performance_report, wait\nimport os\nimport time\nimport numpy as np\n\nos.environ[\"DASK_DISTRIBUTED__COMM__UCX__INFINIBAND\"] = \"True\"\n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize Deisa\nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# either: Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n# or: Get data descriptor as a dict of Dask array\n# arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\narrays.validate_contract()\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    results = []\n    for i in range(25):\n        \n        cpt = np.sum(gt[i])\n\n        s = client.persist(cpt, release=True)\n\n        results.append(client.compute(s))\n\n    del gt\n\n# Write the results\nwith open(\"results.log\", \"a\") as f:\n    result = [cpt.result() for cpt in results]\n    f.write(str(result))\n\nprint(\"{:&lt;21}\".format(\"EST_ANALYTICS_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"source":{"id":"1213"}},"id":"1279","type":"CDSView"},{"attributes":{"coordinates":null,"formatter":{"id":"1432"},"group":null,"major_label_policy":{"id":"1433"},"ticker":{"id":"1013"},"visible":false},"id":"1012","type":"LinearAxis"},{"attributes":{},"id":"1141","type":"ResetTool"},{"attributes":{"range_padding":0},"id":"1112","type":"DataRange1d"},{"attributes":{"days":[1,4,7,10,13,16,19,22,25,28]},"id":"1530","type":"DaysTicker"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n
